/* Base de données: base_allo_docteur */

DROP DATABASE IF EXISTS base_allo_docteur;
DROP USER IF EXISTS 'application'@'localhost';
CREATE DATABASE base_allo_docteur DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;
CREATE USER 'application'@'localhost' IDENTIFIED BY 'passw0rd';
GRANT ALL ON base_allo_docteur.* TO 'application'@'localhost' IDENTIFIED BY 'passw0rd';
USE base_allo_docteur;


SET FOREIGN_KEY_CHECKS = 0; 
DROP TABLE IF EXISTS Utilisateur;
DROP TABLE IF EXISTS Adresse;
DROP TABLE IF EXISTS Creneau;
DROP TABLE IF EXISTS Medecin;
DROP TABLE IF EXISTS Patient;
DROP TABLE IF EXISTS RendezVous;


 
CREATE TABLE Utilisateur (
	idUtilisateur INTEGER PRIMARY KEY AUTO_INCREMENT,
	civilite VARCHAR(100),
	prenom VARCHAR(100),
	nom VARCHAR(100),
	identifiant VARCHAR(100),
	motPasse VARCHAR(100),
	dateNaissance TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	dateCreation TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	dateModification TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	actif TINYINT(1) DEFAULT 1,
	marquerEffacer  TINYINT(1) DEFAULT 0,
	version INTEGER DEFAULT 1
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
 
 

 CREATE TABLE Medecin (
	idMedecin INTEGER PRIMARY KEY AUTO_INCREMENT,
	idUtilisateur INTEGER NOT NULL,
	numeroAccreditation VARCHAR(100),
	numeroTelephone VARCHAR(100),
	version INTEGER DEFAULT 1,
	CONSTRAINT `FK_Medecin_Utilisateur` FOREIGN KEY (idUtilisateur) referenceS Utilisateur (idUtilisateur) ON DELETE CASCADE
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
 
 CREATE TABLE Patient (
	idPatient INTEGER PRIMARY KEY AUTO_INCREMENT,
	idUtilisateur INTEGER NOT NULL,
	numeroSecuriteSociale VARCHAR(100),
	numeroTelephone VARCHAR(100),
	version INTEGER DEFAULT 1,
	CONSTRAINT `FK_Patient_Utilisateur` FOREIGN KEY (idUtilisateur) referenceS Utilisateur (idUtilisateur) ON DELETE CASCADE
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;

 
 CREATE TABLE Adresse (
	idAdresse INTEGER PRIMARY KEY AUTO_INCREMENT,
	idUtilisateur INTEGER NOT NULL,
	rue VARCHAR(100),
	codePostal VARCHAR(100),
	ville VARCHAR(100),
	pays VARCHAR(100),
	principale TINYINT(1) DEFAULT 0,
	version INTEGER DEFAULT 1,
	CONSTRAINT `FK_Adresse_Utilisateur` FOREIGN KEY (idUtilisateur) referenceS Utilisateur (idUtilisateur) ON DELETE CASCADE
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;

 
 CREATE TABLE Creneau (
	idCreneau INTEGER PRIMARY KEY AUTO_INCREMENT,
	idMedecin INTEGER NOT NULL,
	heureDebut INTEGER,
	minuteDebut INTEGER,
	heureFin INTEGER,
	minuteFin INTEGER,
	version INTEGER DEFAULT 1,
	CONSTRAINT `FK_Creneau_Medecin` FOREIGN KEY (idMedecin) referenceS Medecin (idMedecin) ON DELETE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE RendezVous (
	idRendezVous INTEGER PRIMARY KEY AUTO_INCREMENT,
	jour Date NOT NULL,
	prixConsultation double,
	present TINYINT(1) DEFAULT 0,
	idPatient INTEGER NOT NULL,
	idCreneau INTEGER NOT NULL,
	version INTEGER DEFAULT 1,
	CONSTRAINT `FK_RendezVous_Patient` FOREIGN KEY (idPatient) referenceS Patient (idPatient) ON DELETE CASCADE,
	CONSTRAINT `FK_RendezVous_Creneau` FOREIGN KEY (idCreneau) referenceS Creneau (idCreneau) ON DELETE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;
	
ALTER TABLE RendezVous ADD CONSTRAINT UNIQUE_RendezVous UNIQUE (jour,idCreneau);











































